import React, {Component} from 'react';
import Todos from "./components/Todos/Todos";
import './App.css';
import tachyons from 'tachyons';

class App extends Component {
    state = {
        todos: [
            {
                id: 1,
                title: 'Prepare dinner, Kofte and Pilaf',
                completed: false
            },
            {
                id: 2,
                title: 'Text wife about Sila',
                completed: true
            },
            {
                id: 3,
                title: 'Job meeting @ Lorem Epsum',
                completed: true
            },
        ]
    }

    markComplete = (id) => {
        this.setState({todos: id})
    }

    render() {
        return (
            <div className="App">
                <Todos todos={this.state.todos}/>
            </div>
        );
    }
}

export default App;
